INSERT INTO `bff_svc` (`id`, `type`, `keyword`, `module`, `module_title`, `title`, `price`, `settings`, `modified`, `modified_uid`, `icon_b`, `icon_s`, `num`) VALUES
(1, 1, 'up', 'bbs', 'Объявления', 'Поднятие', 5, 'a:7:{s:6:"period";i:1;s:5:"color";s:7:"#F5F5F5";s:8:"add_form";i:0;s:2:"on";i:1;s:10:"title_view";a:2:{s:2:"ru";s:16:"Поднятие";s:2:"uk";s:16:"Поднятие";}s:11:"description";a:2:{s:2:"ru";s:459:"Повышая приоритет вашего объявления вы поднимаете его в начало списка объявлений схожей тематики. \r\nЭто удобный способ для привлечения внимания посетителей портала к вашему предложению.\r\nСтаньте первыми в списке и будете лидером по числу просмотров.";s:2:"uk";s:459:"Повышая приоритет вашего объявления вы поднимаете его в начало списка объявлений схожей тематики. \r\nЭто удобный способ для привлечения внимания посетителей портала к вашему предложению.\r\nСтаньте первыми в списке и будете лидером по числу просмотров.";}s:16:"description_full";a:2:{s:2:"ru";s:489:"<p>Повышая приоритет вашего объявления вы поднимаете его в начало списка объявлений схожей тематики.&nbsp;\r\n</p><p>Это удобный способ для привлечения внимания посетителей портала к вашему предложению.&nbsp;</p><p>Станьте первыми в списке и будете лидером по числу просмотров.</p>";s:2:"uk";s:489:"<p>Повышая приоритет вашего объявления вы поднимаете его в начало списка объявлений схожей тематики.&nbsp;\r\n</p><p>Это удобный способ для привлечения внимания посетителей портала к вашему предложению.&nbsp;</p><p>Станьте первыми в списке и будете лидером по числу просмотров.</p>";}}', '2014-07-11 19:45:01', 1, 'cb1c.png', '780d.png', 1),
(2, 1, 'mark', 'bbs', 'Объявления', 'Выделение', 6, 'a:7:{s:6:"period";i:7;s:5:"color";s:7:"#F5F5F5";s:8:"add_form";i:1;s:2:"on";i:1;s:10:"title_view";a:2:{s:2:"ru";s:18:"Выделение";s:2:"uk";s:18:"Выделение";}s:11:"description";a:2:{s:2:"ru";s:321:"Объявление выделяется желтым фоном на всё время размещения на сайте. \r\nВыделение объявления — отличный способ сделать ваше объявление более ярким и заметным на фоне соседних.";s:2:"uk";s:321:"Объявление выделяется желтым фоном на всё время размещения на сайте. \r\nВыделение объявления — отличный способ сделать ваше объявление более ярким и заметным на фоне соседних.";}s:16:"description_full";a:2:{s:2:"ru";s:338:"<p>Объявление выделяется желтым фоном на всё время размещения на сайте.&nbsp;</p><p>Выделение объявления — отличный способ сделать ваше объявление более ярким и заметным на фоне соседних.</p>";s:2:"uk";s:338:"<p>Объявление выделяется желтым фоном на всё время размещения на сайте.&nbsp;</p><p>Выделение объявления — отличный способ сделать ваше объявление более ярким и заметным на фоне соседних.</p>";}}', '2014-07-11 19:45:12', 1, 'ee4c.png', '04c8.png', 2),
(4, 1, 'fix', 'bbs', 'Объявления', 'Закрепление', 3, 'a:7:{s:6:"period";i:7;s:5:"color";s:7:"#F5F5F5";s:8:"add_form";i:1;s:2:"on";i:1;s:10:"title_view";a:2:{s:2:"ru";s:22:"Закрепление";s:2:"uk";s:22:"Закрепление";}s:11:"description";a:2:{s:2:"ru";s:335:"Закрепив объявление  вы поднимаете его в начало списка объявлений схожей тематики на 7 дней.\r\n - в 10 раз больше просмотров\r\n- в 5 раз больше откликов\r\n- продажа совершается гораздо быстрее";s:2:"uk";s:335:"Закрепив объявление  вы поднимаете его в начало списка объявлений схожей тематики на 7 дней.\r\n - в 10 раз больше просмотров\r\n- в 5 раз больше откликов\r\n- продажа совершается гораздо быстрее";}s:16:"description_full";a:2:{s:2:"ru";s:375:"<p>Закрепив объявление  вы поднимаете его в начало списка объявлений схожей тематики на 7 дней.&nbsp; </p><p>- В 10 раз больше просмотров&nbsp;</p><p>- В 5 раз больше откликов&nbsp;</p><p>- Продажа совершается гораздо быстрее</p>";s:2:"uk";s:375:"<p>Закрепив объявление  вы поднимаете его в начало списка объявлений схожей тематики на 7 дней.&nbsp; </p><p>- В 10 раз больше просмотров&nbsp;</p><p>- В 5 раз больше откликов&nbsp;</p><p>- Продажа совершается гораздо быстрее</p>";}}', '2014-05-30 11:04:18', 1, '54f2.png', '0d8a.png', 3),
(8, 1, 'premium', 'bbs', 'Объявления', 'Премиум', 8, 'a:7:{s:6:"period";i:5;s:5:"color";s:7:"#F5F5F5";s:8:"add_form";i:0;s:2:"on";i:0;s:10:"title_view";a:2:{s:2:"ru";s:14:"Премиум";s:2:"uk";s:14:"Премиум";}s:11:"description";a:2:{s:2:"ru";s:0:"";s:2:"uk";s:0:"";}s:16:"description_full";a:2:{s:2:"ru";s:0:"";s:2:"uk";s:0:"";}}', '2015-09-13 23:25:11', 1, 'db17.png', '47cc.png', 6),
(16, 1, 'press', 'bbs', 'Объявления', 'Публикация в прессе', 10, 'a:7:{s:6:"period";i:1;s:5:"color";s:7:"#F5F5F5";s:8:"add_form";i:0;s:2:"on";i:1;s:10:"title_view";a:2:{s:2:"ru";s:36:"Публикация в прессе";s:2:"uk";s:36:"Публикация в прессе";}s:11:"description";a:2:{s:2:"ru";s:454:"Вы можете сделать ваше объявление более заметным, опубликовав его в прессе. Объявления публикуются в городской газете города. Газета выходит каждую среду, продается во всех газетных киосках. Более подробные условия можно узнать, обратившись к нам.";s:2:"uk";s:454:"Вы можете сделать ваше объявление более заметным, опубликовав его в прессе. Объявления публикуются в городской газете города. Газета выходит каждую среду, продается во всех газетных киосках. Более подробные условия можно узнать, обратившись к нам.";}s:16:"description_full";a:2:{s:2:"ru";s:497:"<p>Вы можете сделать ваше объявление более заметным, опубликовав его в прессе.&nbsp;</p><p>Объявления публикуются в городской газете города.&nbsp;</p><p>Газета выходит каждую среду, продается во всех газетных киосках.&nbsp;</p><p>Более подробные условия можно узнать, обратившись к нам.</p>";s:2:"uk";s:497:"<p>Вы можете сделать ваше объявление более заметным, опубликовав его в прессе.&nbsp;</p><p>Объявления публикуются в городской газете города.&nbsp;</p><p>Газета выходит каждую среду, продается во всех газетных киосках.&nbsp;</p><p>Более подробные условия можно узнать, обратившись к нам.</p>";}}', '2014-05-30 11:04:18', 1, 'bb34.png', '5e16.png', 7),
(17, 2, 'import', 'bbs', 'Объявления', 'Пакет "Турбо"', 25, 'a:7:{s:5:"color";s:7:"#F5F5F5";s:8:"add_form";i:0;s:2:"on";i:1;s:3:"svc";a:4:{s:4:"mark";a:2:{s:2:"id";i:2;s:3:"cnt";i:5;}s:3:"fix";a:2:{s:2:"id";i:4;s:3:"cnt";i:5;}s:5:"quick";a:2:{s:2:"id";i:32;s:3:"cnt";i:15;}s:5:"press";a:2:{s:2:"id";i:16;s:3:"cnt";i:0;}}s:10:"title_view";a:2:{s:2:"ru";s:23:"Пакет "Турбо"";s:2:"uk";s:23:"Пакет "Турбо"";}s:11:"description";a:2:{s:2:"ru";s:342:"Хотите продать свой товар/услугу максимально быстро? Тогда это предложение именно для вас:\r\n- Закрепление объявления на 5 дней\r\n- Выделение объявления на 5 дней\r\n- Пометка “Срочно” на 15 дней";s:2:"uk";s:342:"Хотите продать свой товар/услугу максимально быстро? Тогда это предложение именно для вас:\r\n- Закрепление объявления на 5 дней\r\n- Выделение объявления на 5 дней\r\n- Пометка “Срочно” на 15 дней";}s:16:"description_full";a:2:{s:2:"ru";s:382:"<p>Хотите продать свой товар/услугу максимально быстро? Тогда это предложение именно для вас:&nbsp;</p><p>- Закрепление объявления на 5 дней&nbsp;</p><p>- Выделение объявления на 5 дней&nbsp;</p><p>- Пометка “Срочно” на 15 дней</p>";s:2:"uk";s:382:"<p>Хотите продать свой товар/услугу максимально быстро? Тогда это предложение именно для вас:&nbsp;</p><p>- Закрепление объявления на 5 дней&nbsp;</p><p>- Выделение объявления на 5 дней&nbsp;</p><p>- Пометка “Срочно” на 15 дней</p>";}}', '2014-05-30 11:04:18', 1, '6e94.png', 'c12a.png', 2),
(32, 1, 'quick', 'bbs', 'Объявления', 'Срочно', 2, 'a:7:{s:6:"period";i:7;s:5:"color";s:7:"#F5F5F5";s:8:"add_form";i:1;s:2:"on";i:1;s:10:"title_view";a:2:{s:2:"ru";s:12:"Срочно";s:2:"uk";s:12:"Срочно";}s:11:"description";a:2:{s:2:"ru";s:394:"Пометьте объявление как срочное до тех пор, пока вы не продадите свой товар.\r\n- вы привлекаете больше внимания, а значит получаете больше откликов\r\n- ваше объявление становится более заметным среди других предложений";s:2:"uk";s:394:"Пометьте объявление как срочное до тех пор, пока вы не продадите свой товар.\r\n- вы привлекаете больше внимания, а значит получаете больше откликов\r\n- ваше объявление становится более заметным среди других предложений";}s:16:"description_full";a:2:{s:2:"ru";s:423:"<p>Пометьте объявление как срочное до тех пор, пока вы не продадите свой товар.&nbsp;</p><p>- Вы привлекаете больше внимания, а значит получаете больше откликов&nbsp;</p><p>- Ваше объявление становится более заметным среди других предложений</p>";s:2:"uk";s:423:"<p>Пометьте объявление как срочное до тех пор, пока вы не продадите свой товар.&nbsp;</p><p>- Вы привлекаете больше внимания, а значит получаете больше откликов&nbsp;</p><p>- Ваше объявление становится более заметным среди других предложений</p>";}}', '2014-05-30 11:04:18', 1, '0eba.png', '2ccc.png', 4),
(64, 1, 'fix_shop', 'shops', 'Магазины', 'Закрепление', 2, 'a:6:{s:6:"period";i:5;s:5:"color";s:0:"";s:2:"on";i:1;s:10:"title_view";a:2:{s:2:"ru";s:22:"Закрепление";s:2:"uk";s:22:"Закрепление";}s:11:"description";a:2:{s:2:"ru";s:225:"Закрепив магазин вы поднимаете его в начало списка магазинов на 5 дней.\r\n - в 10 раз больше просмотров\r\n- в 5 раз больше откликов";s:2:"uk";s:225:"Закрепив магазин вы поднимаете его в начало списка магазинов на 5 дней.\r\n - в 10 раз больше просмотров\r\n- в 5 раз больше откликов";}s:16:"description_full";a:2:{s:2:"ru";s:241:"<p>Закрепив магазин вы поднимаете его в начало списка магазинов на 5 дней.</p><p>- в 10 раз больше просмотров</p><p>- в 5 раз больше откликов</p>";s:2:"uk";s:241:"<p>Закрепив магазин вы поднимаете его в начало списка магазинов на 5 дней.</p><p>- в 10 раз больше просмотров</p><p>- в 5 раз больше откликов</p>";}}', '2014-07-12 18:22:10', 1, 'f532.png', '50d7.png', 8),
(128, 1, 'mark_shop', 'shops', 'Магазины', 'Выделение', 3, 'a:6:{s:6:"period";i:7;s:5:"color";s:0:"";s:2:"on";i:1;s:10:"title_view";a:2:{s:2:"ru";s:18:"Выделение";s:2:"uk";s:18:"Выделение";}s:11:"description";a:2:{s:2:"ru";s:272:"Магазин выделяется желтым фоном на период 7 дней. \r\nВыделение магазина — отличный способ сделать ваш магазин более ярким и заметным на фоне соседних.";s:2:"uk";s:272:"Магазин выделяется желтым фоном на период 7 дней. \r\nВыделение магазина — отличный способ сделать ваш магазин более ярким и заметным на фоне соседних.";}s:16:"description_full";a:2:{s:2:"ru";s:294:"<p>Магазин выделяется желтым фоном&nbsp;на период 7 дней.&nbsp;</p><p>Выделение магазина — отличный способ сделать ваш магазин более ярким и заметным на фоне соседних.</p>";s:2:"uk";s:294:"<p>Магазин выделяется желтым фоном&nbsp;на период 7 дней.&nbsp;</p><p>Выделение магазина — отличный способ сделать ваш магазин более ярким и заметным на фоне соседних.</p>";}}', '2014-06-23 11:24:41', 1, '3ae8.png', '976d.png', 9);
